import React from 'react';
import picture from '../../images/features/desktop'

const FeaturesHeader = () => {
    return (
        <div className="features__header">
        <div className="features__header__textbox">
            <h1 className="features__header__textbox--heading">
                Features
            </h1>
            <p className="features__header__textbox--subheading">
                We make sure all of our features are designed to be loved by every aspiring and even professional photograpers who wanted to share their stories.
            </p>
        </div>
        <div className="features__header__image__container">
            <img 
                className="features__header__image__container--image"
                //src={picture}
                alt="Professional camera in hand for photography"
            />
        </div>
    </div>

    )
}

export default FeaturesHeader;
